Use compression policies to automatically compress chunks older than a specified interval:

```sql
ALTER TABLE sensor_data SET (
  timescaledb.compress,
  timescaledb.compress_segmentby = 'sensor_id'
);

SELECT add_compression_policy('sensor_data', INTERVAL '7 days');
```

This compresses data older than 7 days automatically. For more compression strategies, check references/compression.md.
